import { Avatar, Box, Card, CardHeader, IconButton } from '@mui/material'
import React from 'react'

const Feed = () => {
    return (
        <Box bgcolor="pink" flex={4} p={2}>
            <Card >
                <CardHeader
                avatar={
                    <Avatar sx={{ bgcolor: red[500]}} arial-label="recipe">

                    </Avatar>
                }
                action={
                    <IconButton arial-label="settings">
                        <M />
                    </IconButton>
                }
                title="Shrimp and Chorizo Paella"
                subheader="September 14, 2016"
                />
            </Card>
            </Box>
    )
}

export default Feed
